15CM396 & 15CM397 - Defendant James L. Narr in court with attorney Jacquelyn Wolter.  Gilbert Grant Thompson appeared for the State of Wisconsin. Agreement reached. Victim rights compliance. Court reviews rights, charges and penalties. Def enters NC plea to 15CM396 Ct 2 DC and 15CM397 Ct 2 Bail Jumping. Court accepts pleas and finds guilty of charges, all other charges are DRI. ADA Thompson heard. Atty Wolter heard. Court heard and imposes sentence:

18 months probation w/h;
Counseling as determined by agent;
No violent/abusive contact w/anyone;
Comply with treatment as determined by dr;
Costs;
All Financial obligations shall be paid to the Clerk of Courts within 60 days unless a payment plan is established.

Discussion held. Cash bond to be applied to costs and remainder to be paid at rate of $50/mo comm 5/1/15 and 1st of each month until paid.
